<div class="entities" style="line-height: 2.5; direction: ltr">Stress-induced corticotropin-releasing hormone-mediated P59044 inflammasome inhibition and transmissible enteritis in mice . BACKGROUND &amp; AIMS : Stress alters brain-gut interactions and could exacerbate intestinal disorders , including irritable bowel syndrome . Alterations in the intestinal microbiota have been associated with irritable bowel syndrome . Maintenance of healthy microbiota requires nucleotide-binding oligomerization domain protein-like receptors , pyrin-domain containing ( NLRP ) - 6 inflammasomes . We investigated the involvement of P59044 in water-avoidance stress ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) - induced intestinal disorders in mice . METHODS : B57BL6 mice were subjected to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 for 1 hour each day for 10 days ; body weights and intestinal inflammation and permeability were analyzed . We investigated signaling via the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q96P20
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and P59044 inflammasomes , and the role of corticotropin-releasing hormone ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06850
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) in 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - associated inflammation and P59044 inhibition . Mice that were not exposed to stress were co-housed with mice subjected to 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 to determine the effects of 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - induced dysbiosis , measured by sequencing bacterial 16S ribosomal RNA . We also assessed the effects of a peroxisome proliferator-activated receptor- agonist and probiotics . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - induced small-bowel inflammation ( enteritis ) was associated with inhibition of P59044 , but not 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    Q96P20
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , and was prevented by a peroxisome proliferator-activated receptor- agonist , which induced epithelial expression of P59044 . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06850
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 was released during 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and inhibited P59044 expression . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 induced alterations in the gut microbiota of mice ; co-housed nonstressed mice developed enteritis associated with increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P06850
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 and decreased levels of P59044 . Probiotic therapy reduced intestinal inflammation in mice with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P42768
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - induced enteritis . CONCLUSIONS : Exposure of mice to stress inhibits P59044 and alters the composition of the gut microbiota , leading to intestinal inflammation . These findings might explain the benefits of probiotics for patients with stress-associated gastrointestinal disorders .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Endoplasmic reticulum calcium depletion impacts chaperone secretion , innate immunity , and phagocytic uptake of cells . A number of immunological functions are ascribed to cell surface-expressed forms of the endoplasmic reticulum ( ER ) chaperone calreticulin ( CRT ) . In this study , we examined the impact of ER stress-inducing drugs upon cell surface CRT induction and the resulting immunological consequences . We showed that cell surface expression of CRT and secretion of CRT , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P11021
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 , gp96 , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P07237
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 were induced by thapsigargin ( THP ) treatment , which depletes ER calcium , but not by tunicamycin treatment , which inhibits protein glycosylation . Surface expression of CRT in viable , THP-treated fibroblasts correlated with their enhanced phagocytic uptake by bone marrow-derived dendritic cells . Incubation of bone marrow-derived dendritic cells with THP-treated fibroblasts enhanced sterile 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P05231
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 production and LPS-induced generation of IL - 1 , IL - 12 , IL - 23 , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01375
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>

 -  . However , extracellular CRT is not required for enhanced proinflammatory responses . Furthermore , the pattern of proinflammatory cytokine induction by THP-treated cells and cell supernatants resembled that induced by THP itself and indicated that other ER chaperones present in supernatants of THP-treated cells also do not contribute to induction of the innate immune response . Thus , secretion of various ER chaperones , including CRT , is induced by ER calcium depletion . CRT , previously suggested as an eat-me signal in dead and dying cellular contexts , can also promote phagocytic uptake of cells subject to ER calcium depletion . Finally , there is a strong synergy between calcium depletion in the ER and sterile 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 , as well as LPS-dependent IL - 1 , IL - 12 , IL - 23 , and 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 -  innate responses , findings that have implications for understanding inflammatory diseases that originate in the ER .</div>

 ) in vitro and in vivo . It is similar in molecular size to the 41 - residue ovine CRF ( oCRF ) or rat CRF ( rCRF ) recently elucidated and appears to be their bovine counterpart . Immunoreactivity of CRF-B was examined in homologous radioimmunoassays ( RIAs ) for oCRF or rCRF , using several anti-oCRF and anti-rCRF antibodies . CRF-B cross-reacted well with anti-oCRF antibodies but poorly with anti-rCRF antibodies . Purification of CRF-B with preparative isoelectric focusing yielded four CRF peaks , B - 1 ( pH 4.7 ) , B - 2 ( pH 5.5 ) , B - 3 ( pH 6.3 ) , and B - 4 ( pH 7.0 ) , which accounted for 16 , 30 , 46 , and 8 % of the total immunoreactivity , respectively . CRF B - 2 , B - 3 , and B - 4 showed both immunological activity and biological activity in vitro ( cell culture assay ) and in vivo ( Arimura assay ) , whereas CRF B - 1 showed only immunoreactivity . Their relative bioactivity / immunoreactivity ratios were 0 ( B - 1 ) , 1 ( B - 2 ) , 1 ( B - 3 ) , and 3 ( B - 4 ) . All of these CRF-B subtypes exhibited RIA displacement curves parallel to that for the oCRF standard and coeluted with oCRF on Sephadex G - 100 chromatography , which suggests that their molecular modifications are relatively minor .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Mechanism of bradykinin-induced Ca ( 2 + ) mobilization in MG63 human osteosarcoma cells . BACKGROUND : The effect of bradykinin on intracellular free Ca ( 2 + ) levels ( [ Ca ( 2 + ) ] ( i ) ) in MG63 human osteosarcoma cells was explored using fura - 2 as a Ca ( 2 + ) dye . METHODS / RESULTS : Bradykinin ( 0.1 nM - 1 microM ) increased [ Ca ( 2 + ) ] ( i ) in a concentration-dependent manner with an EC ( 50 ) value of 0.5 nM . The [ Ca ( 2 + ) ] ( i ) signal comprised an initial peak and a fast decay which returned to baseline in 2 min . Extracellular Ca ( 2 + ) removal inhibited the peak [ Ca ( 2 + ) ] ( i ) signals by 35 + / - 3 % . Bradykinin ( 1 nM ) failed to increase [ Ca ( 2 + ) ] ( i ) in the absence of extracellular Ca ( 2 + ) after cells were pretreated with thapsigargin ( an endoplasmic reticulum Ca ( 2 + ) pump inhibitor ; 1 microM ) . Bradykinin ( 1 nM ) - induced intracellular Ca ( 2 + ) release was nearly abolished by inhibiting phospholipase C with 2 microM 1 - ( 6 - ( ( 17 beta - 3 - methoxyestra -1,3 , 5 ( 10 ) - trien - 17 - yl ) amino ) hexyl ) - 1H - pyrrole -2,5- dione ( U73122 ) . The [ Ca ( 2 + ) ] ( i ) increase induced by 1 nM bradykinin in Ca ( 2 + ) - free medium was abolished by 1 nM
